import { createNativeStackNavigator } from '@react-navigation/native-stack';

const { Navigator, Screen } = createNativeStackNavigator();

import { Home } from '../screens/Home';
import { New } from '../screens/CreateBooks';
import { Book } from '../screens/Book';
import { FavBooks } from '../screens/FavBooks';
import { Folders } from '../screens/Folders';
import { Folder } from '../screens/Folder';
import { NoteDark } from '../screens/NoteDark';
import { NoteWhite } from '../screens/NoteWhite';
import { CreateNotes } from '../screens/CreateNotes';
import { EditBook } from '../screens/EditBook';
import { EditNote } from '../screens/EditNote';
import { CreateFolders } from '../screens/CreateFolders';
import { EditFolder } from '../screens/EditFolder';
import { AddBookInFolder } from '../screens/AddBookInFolder';



export function AppRoutes() {
  return (
    <Navigator screenOptions={{ headerShown: false }}>
      <Screen
        name="home"
        component={Home}
      />

      <Screen
        name="new"
        component={New}
      />

      <Screen
        name="book"
        component={Book}
      />

      <Screen
        name="favbooks"
        component={FavBooks}
      />

      <Screen
        name="folders"
        component={Folders}
      />

      <Screen
        name="folder"
        component={Folder}
      />

      <Screen
        name="noted"
        component={NoteDark}
      />

      <Screen
        name="notew"
        component={NoteWhite}
      />

      <Screen
        name="createnotes"
        component={CreateNotes}
      />

      <Screen
        name="editbook"
        component={EditBook}
      />

      <Screen
        name="editnote"
        component={EditNote}
      />

      <Screen
        name="createfolders"
        component={CreateFolders}
      />

      <Screen
        name="editfolder"
        component={EditFolder}
      />

      <Screen
        name="addbookinfolder"
        component={AddBookInFolder}
      />
    </Navigator>
  )
}
